import React, { useEffect, useState } from 'react';
import { Box, Card, CardContent, Typography, Stack } from '@mui/material';
import { subscribeToTelemetry } from '../api/socket';

const TelemetryPanel = () => {
  const [data, setData] = useState({});

  useEffect(() => {
    const unsubscribe = subscribeToTelemetry((incoming) => {
      console.log('üì° Received telemetry:', incoming);
      setData(incoming);
    });
    return () => unsubscribe();
  }, []);

  return (
    <Stack
      spacing={2}
      alignItems="center"
      justifyContent="center"
      sx={{ width: '100%', pt: 2 }}
    >
      <Card sx={{ width: '100%', maxWidth: 360 }}>
        <CardContent>
          <Typography variant="h6" color="primary">üîã Battery</Typography>
          <Typography variant="body1">
            {data.battery?.toFixed?.(2) ?? 'N/A'} V
          </Typography>
        </CardContent>
      </Card>

      <Card sx={{ width: '100%', maxWidth: 360 }}>
        <CardContent>
          <Typography variant="h6" color="primary">üì° Connection</Typography>
          <Typography variant="body1">
            {data.connection ?? 'N/A'}
          </Typography>
        </CardContent>
      </Card>

      <Card sx={{ width: '100%', maxWidth: 360 }}>
        <CardContent>
          <Typography variant="h6" color="primary">üìç GPS</Typography>
          <Typography variant="body1">
            Lat: {data.gps?.lat?.toFixed?.(4) ?? 'N/A'}, Lon: {data.gps?.lon?.toFixed?.(4) ?? 'N/A'}
          </Typography>
          <Typography variant="body2">
            Alt: {data.gps?.alt?.toFixed?.(2) ?? 'N/A'} m
          </Typography>
        </CardContent>
      </Card>

      <Card sx={{ width: '100%', maxWidth: 360 }}>
        <CardContent>
          <Typography variant="h6" color="primary">üìà IMU</Typography>
          <Typography variant="body1">
            Roll: {data.imu?.roll?.toFixed?.(2) ?? 'N/A'}¬∞, 
            Pitch: {data.imu?.pitch?.toFixed?.(2) ?? 'N/A'}¬∞, 
            Yaw: {data.imu?.yaw?.toFixed?.(2) ?? 'N/A'}¬∞
          </Typography>
        </CardContent>
      </Card>

      <Card sx={{ width: '100%', maxWidth: 360 }}>
        <CardContent>
          <Typography variant="h6" color="primary">üå°Ô∏è Temperature</Typography>
          <Typography variant="body1">
            {data.temperature?.toFixed?.(1) ?? 'N/A'} ¬∞C
          </Typography>
        </CardContent>
      </Card>

      <Card sx={{ width: '100%', maxWidth: 360 }}>
        <CardContent>
          <Typography variant="h6" color="primary">üß≠ Altitude</Typography>
          <Typography variant="body1">
            {data.altitude?.toFixed?.(2) ?? 'N/A'} m
          </Typography>
        </CardContent>
      </Card>
    </Stack>
  );
};

export default TelemetryPanel;
